INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, -416.5, "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", "ペコリーヌ", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 105801, 12001, 12, 0);
