INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, -363.0, "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", "コッコロ", 1, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 105901, 13002, 13, 0);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 2104010, -363.0, "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", "シェフィ", 2, "2015/12/17 15:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 1, 106401, 13003, 13, 0);
