INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 4.08, 1, 109001, 24001, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 5.0, 2, 109001, 24002, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 10.11, 3, 109001, 24003, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 4.0, 4, 109001, 24004, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 6.0, 5, 109001, 24005, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 6, 109002, 24006, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 7, 109002, 24007, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 8, 109002, 24008, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 9, 109002, 24009, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", "エリコ（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 10, 109002, 24010, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 2.12, 1, 109101, 24011, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", "シズル（バレンタイン）", 5, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 4.19, 2, 109101, 24012, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (4, 0, -385.0, "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", "シズル（バレンタイン）", 2, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 2.3, 3, 109101, 24013, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 4, 109102, 24014, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", "シズル（バレンタイン）", 5, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 5.23, 5, 109101, 24015, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 6, 109102, 24016, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (2, 0, -385.0, "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 8.0, 5.01, 7, 109101, 24017, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 8, 109102, 24018, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 9, 109102, 24019, 24, 10011);
INSERT INTO `v1_2f3942bc1d5efe31ede5fab54bef72093e728da0606f0361fae468ab3f20841f` VALUES (1, 0, 0.0, "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", "シズル（バレンタイン）", 1, "2019/01/31 12:00:00", "2030/12/17 14:59:59", 0.0, 0.0, 10, 109102, 24020, 24, 10011);
